import React,{useState} from 'react'

const User = (props) => {
    const [name, setName] = useState("Waliullah")
    const ChangeTo=()=>{
        setName("Habiba")
    }
    return (
        <div>
            <h1>Student details</h1>
           <h3> name : {props.name}, Age: {props.age}</h3>
           <button onClick={ChangeTo}>Click me</button>
        </div>
    )
}

export default User
